import styled from 'styled-components';
export const Div0 = styled.div`
    width: 100%;
    margin: 0 auto;
    height:60px;
    background-color:#445553;
    display: flex;
`
export const Logo=styled.div`
    padding-left:5px;
    width:100px;
    float:left;
`;
export const Personal=styled.div`
    font-size:24px;
    color:white;
    font-family: 'Noto Sans TC', sans-serif;
    width: 72px;
    margin-top: 27px;
    background-color:blue;
    float:right;
`
export const LogoText=styled.p`
    font-size:24px;
    color:white;
    font-family: 'Noto Sans TC', sans-serif;
    width: 120px;
    margin-top: 27px;
    float:left;
`;
